import './App.css';
import logo from './images/wre-logo.png';
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import LandingPage from './LandingPage/LandingPage';
import BuyAHome from './BuyAHome/BuyAHome';
import SellAHome from './SellAHome/SellAHome';
import FindAnAgent from './FindAnAgent/FindAnAgent';
import AboutUs from './AboutUs/AboutUs';

function App() {
  return (
    <div class="main">

<img class="pull-right"
            src="https://www.userbenchmark.com/resources/img/wri/creatives/assets/flame.gif" alt = "fire">

            </img>
      
      <div class="background">
      </div>

      <div class="navigation-bar">
        
        <nav class = "navigation">
          <a to="/">
            <img src={ logo } alt="logo" />
          </a>
          <a to="/Buy">
            <span class="navlink-text">Buy a Home</span>
          </a> 
          <a to="/Sell">
            <span class="navlink-text">Sell a Home</span>
          </a>
          <a to="/FindAgent">
            <span class="navlink-text">Find an Agent</span>
          </a> 
          <a to="/About">
            <span class="navlink-text">About Us</span>
          </a>
        </nav>

      </div>

      <div class="buyAHome">
            <h1>Buy a Home</h1>
            {/* <iframe src="https://smartmls.mlsmatrix.com/Matrix/public/IDX.aspx?idx=0f243f8" width="100%" height="100%" frameborder="0" marginwidth="0" marginheight="0"></iframe> */}
      </div>
      <div class="sellAHome">
            <h1>Sell a Home</h1>
      </div>
      <div class="main2">
            <h1>About Us</h1>
      </div>

    </div>
  );
}

export default App;
